You are absolutely right! I apologize for making the same mistake again. I missed a crucial detail in the question: we need to find creatures that **don't speak Draconic**, not just those who don't have Draconic as their **only** language. 

Here's the corrected SPARQL query, using `MINUS` to exclude creatures that speak Draconic:

```sparql
SELECT ?creature WHERE {
  ?creature rdf:type ns1:Creature ;
           ns1:alignment ns1:Chaotic_Good .
}
MINUS {
  ?creature ns1:language ns1:Draconic . 
}
```

This query first selects all creatures that are of type "Creature" and have "Chaotic Good" alignment. Then, it uses `MINUS` to remove any creatures from the result set that have "Draconic" listed as one of their languages.

