```sparql
SELECT ?creature ?alignment
WHERE {
  ?creature rdf:type ns1:Creature .
  ?creature ns1:hasAlignment ?alignment .
  FILTER (?alignment = ns1:ChaoticGood) .
  MINUS {
    ?creature ns1:speaks ns1:Draconic
  }
}
```

