Therefore, the FILTER on alignment should be inside the OPTIONAL clause:

```sparql
SELECT ?creature
WHERE {
  ?creature a ns1:Creature .
  OPTIONAL { ?creature ns1:speaks ?language . }
  FILTER NOT EXISTS { ?creature ns1:speaks ns1:Draconic . }
  OPTIONAL { 
    ?creature ns1:hasAlignment ?alignment .
    FILTER (?alignment = ns1:ChaoticGood) 
  }
} 
```

This query now accurately reflects the question's intent: it selects all creatures that are not speakers of Draconic, and among them, it keeps only those that have explicitly defined Chaotic Good alignment. Creatures without a defined alignment are still included in the results.

